// n8n Code node
return items.map(item => {
  let rawText = "";

  try {
    // Navigate safely into content.parts[0].text
    rawText = item.json?.content?.parts?.[0]?.text || "";
  } catch (e) {
    rawText = "";
  }

  // Remove Markdown code block wrappers like ```json ... ```
  rawText = rawText.replace(/```json/g, "").replace(/```/g, "").trim();

  let parsed = {};
  let output = {};

  try {
    // Try parsing JSON
    parsed = JSON.parse(rawText);

    // Copy everything dynamically
    output = { ...parsed };

  } catch (e) {
    // If JSON parsing fails ‚Üí treat as HTML
    output.html = rawText.replace(/\n/g, ""); // remove newline chars
  }

  return { json: output };
});
